from tkinter import ttk
import datetime
import base64
import requests, time, urllib3


class Jxcx(object):
    def __init__(self, username, password):
        self.session = requests.Session()
        self.data = {"username": username,
                     "password": password,
                     "token": ""}
        self.headers = {
            "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.131 Safari/537.36"}
        self.login_url = "https://classroom-courseapi.xiaomawang.com/v1/user/login"
        self.token = None
        urllib3.disable_warnings()

    def login(self):
        response = self.session.post(url=self.login_url, data=self.data, verify=False).json()
        if response["message"] == "操作成功":
            self.token = response["data"]["token"]
            header = {
                "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.131 Safari/537.36",
                "Accept-Encoding": "gzip, deflate",
                "Accept": "*/*",
                "Host": "classroom-courseapi.xiaomawang.com",
                "Access-Token": self.token,
                "Connection": "keep-alive"}
            res = requests.get(
                "https://classroom-courseapi.xiaomawang.com/v1/permission/user/{}".format(self.data["username"]),
                headers=header, verify=False).json()
            res_name = res["data"]["user"]["nickname"]
            res_position = res["data"]["permissionSet"][0]["displayName"]
            time_time = time.time()
            time_time = time.localtime(time_time)
            time_time = int(time.strftime("%H", time_time))
            if time_time > 5 and time_time <= 9:
                print(res_position + res_name, "早上好！")
                text1.insert("end", res_position + res_name, "早上好！")
                text1.see("end")
            elif time_time > 9 and time_time <= 12:
                print(res_position + res_name, "上午好！")
                text1.insert("end", res_position + res_name, "上午好！")
                text1.see("end")
            elif time_time > 12 and time_time <= 18:
                print(res_position + res_name, "下午好！")
                text1.insert("end", res_position + res_name, "下午好！")
                text1.see("end")
            else:
                text1.insert("end", res_position + res_name, "晚上好！")
                text1.see("end")

        if response["message"] == "用户不存在":
            print("用户不存在！")
            text1.insert("end", "用户不存在！")
            text1.see("end")
            # start()
        elif response["message"] == "账号密码错误":
            print("账号密码错误，请输入正确的账号密码！")
            text1.insert("end", "账号密码错误，请输入正确的账号密码！")
            text1.see("end")
        elif response["message"] == "该账号已被禁用":
            print("该账号已被禁用，请输入正确的账号！")
            text1.insert("end", "该账号已被禁用，请输入正确的账号！")
            text1.see("end")
            # start()

    def ResponseJson(self):
        add = cmb.get()
